/* eslint-disable no-restricted-imports */
import React from "react";
import PropTypes from "prop-types";
import Notice from "../../../../partials/content/Notice";
import CodeExample from "../../../../partials/content/CodeExample";
import { makeStyles } from "@material-ui/core/styles";
import {
  ListItem,
  List,
  ListItemIcon,
  ListItemText,
  Divider,
  ListSubheader,
  Collapse,
  ListItemAvatar,
  Avatar,
  Typography,
  Grid,
  Checkbox,
  FormGroup,
  FormControlLabel,
  ListItemSecondaryAction,
  IconButton,
  Switch
} from "@material-ui/core";
import InboxIcon from "@material-ui/icons/Inbox";
import DraftsIcon from "@material-ui/icons/Drafts";
import SendIcon from "@material-ui/icons/Send";
import ExpandLess from "@material-ui/icons/ExpandLess";
import ExpandMore from "@material-ui/icons/ExpandMore";
import StarBorder from "@material-ui/icons/StarBorder";
import ImageIcon from "@material-ui/icons/Image";
import WorkIcon from "@material-ui/icons/Work";
import BeachAccessIcon from "@material-ui/icons/BeachAccess";
import FolderIcon from "@material-ui/icons/Folder";
import DeleteIcon from "@material-ui/icons/Delete";
import CommentIcon from "@material-ui/icons/Comment";
import WifiIcon from "@material-ui/icons/Wifi";
import BluetoothIcon from "@material-ui/icons/Bluetooth";
import StarIcon from "@material-ui/icons/Star";
import { FixedSizeList } from "react-window";

// Example 1
const useStyles1 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

function ListItemLink1(props) {
  return <ListItem button component="a" {...props} />;
}

// Exanple 2
const useStyles2 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  },
  nested: {
    paddingLeft: theme.spacing(4)
  }
}));

// Example 3
const useStyles3 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 4
const useStyles4 = makeStyles(theme => ({
  root: {
    flexGrow: 1,
    maxWidth: 752
  },
  demo: {
    backgroundColor: theme.palette.background.paper
  },
  title: {
    margin: theme.spacing(4, 0, 2)
  }
}));

function generate(element) {
  return [0, 1, 2].map(value =>
    React.cloneElement(element, {
      key: value
    })
  );
}

// Example 5
const useStyles5 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 6
const useStyles6 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  },
  inline: {
    display: "inline"
  }
}));

// Example 7
const useStyles7 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Exanple 8
const useStyles8 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 9
const useStyles9 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 10
const useStyles10 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
    position: "relative",
    overflow: "auto",
    maxHeight: 300
  },
  listSection: {
    backgroundColor: "inherit"
  },
  ul: {
    backgroundColor: "inherit",
    padding: 0
  }
}));

// Example 11
const useStyles11 = makeStyles(theme => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

// Example 12
const useStyles12 = makeStyles(theme => ({
  root: {
    width: "100%",
    height: 400,
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper
  }
}));

function Row12(props) {
  const { index, style } = props;

  return (
    <ListItem button style={style} key={index}>
      <ListItemText primary={`Item ${index + 1}`} />
    </ListItem>
  );
}

Row12.propTypes = {
  index: PropTypes.number,
  style: PropTypes.object
};

export default function ListsExamplesPage() {
  // Example 1
  const classes1 = useStyles1();

  // Example 2
  const classes2 = useStyles2();
  const [open2, setOpen2] = React.useState(true);

  function handleClick2() {
    setOpen2(!open2);
  }

  // Example 3
  const classes3 = useStyles3();

  // Example 4
  const classes4 = useStyles4();
  const [dense4, setDense4] = React.useState(false);
  const [secondary4, setSecondary4] = React.useState(false);

  // Example 5
  const classes5 = useStyles5();
  const [selectedIndex5, setSelectedIndex5] = React.useState(1);

  function handleListItemClick5(event, index) {
    setSelectedIndex5(index);
  }

  // Example 6
  const classes6 = useStyles6();

  // Example 7
  const classes7 = useStyles7();
  const [checked7, setChecked7] = React.useState([0]);

  const handleToggle7 = value => () => {
    const currentIndex = checked7.indexOf(value);
    const newChecked = [...checked7];

    if (currentIndex === -1) {
      newChecked.push(value);
    } else {
      newChecked.splice(currentIndex, 1);
    }

    setChecked7(newChecked);
  };

  // Example 8
  const classes8 = useStyles8();
  const [checked8, setChecked8] = React.useState([1]);

  const handleToggle8 = value => () => {
    const currentIndex = checked8.indexOf(value);
    const newChecked = [...checked8];

    if (currentIndex === -1) {
      newChecked.push(value);
    } else {
      newChecked.splice(currentIndex, 1);
    }

    setChecked8(newChecked);
  };

  // Example 9
  const classes9 = useStyles9();
  const [checked9, setChecked9] = React.useState(["wifi"]);

  const handleToggle9 = value => () => {
    const currentIndex = checked9.indexOf(value);
    const newChecked = [...checked9];

    if (currentIndex === -1) {
      newChecked.push(value);
    } else {
      newChecked.splice(currentIndex, 1);
    }

    setChecked9(newChecked);
  };

  // Example 10
  const classes10 = useStyles10();

  // Example 11
  const classes11 = useStyles11();

  // Example 12
  const classes12 = useStyles12();

  return (
    <>
      <Notice icon="flaticon-warning kt-font-primary">
        <p>Lists are continuous, vertical indexes of text or images</p>
        <p>
          For more info please check the components's official{" "}
          <a
            target="_blank"
            className="kt-link"
            rel="noopener noreferrer"
            href="https://material-ui.com/components/lists/"
          >
            demos & documentation
          </a>
        </p>
      </Notice>

      <div className="row">
        <div className="col-md-6">
          <CodeExample jsCode={jsCode1} beforeCodeTitle="Simple List">
            <div className="kt-section">
              <span className="kt-section__sub"></span>
              <div className="kt-section__content">
                <div className={classes1.root}>
                  <List component="nav" aria-label="Main mailbox folders">
                    <ListItem button>
                      <ListItemIcon>
                        <InboxIcon />
                      </ListItemIcon>
                      <ListItemText primary="Inbox" />
                    </ListItem>
                    <ListItem button>
                      <ListItemIcon>
                        <DraftsIcon />
                      </ListItemIcon>
                      <ListItemText primary="Drafts" />
                    </ListItem>
                  </List>
                  <Divider />
                  <List component="nav" aria-label="Secondary mailbox folders">
                    <ListItem button>
                      <ListItemText primary="Trash" />
                    </ListItem>
                    <ListItemLink1 href="#simple-list">
                      <ListItemText primary="Spam" />
                    </ListItemLink1>
                  </List>
                </div>
              </div>
            </div>
          </CodeExample>
        </div>
        <div className="col-md-6">
          <CodeExample jsCode={jsCode2} beforeCodeTitle="Nested List">
            <div className="kt-section">
              <span className="kt-section__sub"></span>
              <div className="kt-section__content">
                <List
                  component="nav"
                  aria-labelledby="nested-list-subheader"
                  subheader={
                    <ListSubheader component="div" id="nested-list-subheader">
                      Nested List Items
                    </ListSubheader>
                  }
                  className={classes2.root}
                >
                  <ListItem button>
                    <ListItemIcon>
                      <SendIcon />
                    </ListItemIcon>
                    <ListItemText primary="Sent mail" />
                  </ListItem>
                  <ListItem button>
                    <ListItemIcon>
                      <DraftsIcon />
                    </ListItemIcon>
                    <ListItemText primary="Drafts" />
                  </ListItem>
                  <ListItem button onClick={handleClick2}>
                    <ListItemIcon>
                      <InboxIcon />
                    </ListItemIcon>
                    <ListItemText primary="Inbox" />
                    {open2 ? <ExpandLess /> : <ExpandMore />}
                  </ListItem>
                  <Collapse in={open2} timeout="auto" unmountOnExit>
                    <List component="div" disablePadding>
                      <ListItem button className={classes2.nested}>
                        <ListItemIcon>
                          <StarBorder />
                        </ListItemIcon>
                        <ListItemText primary="Starred" />
                      </ListItem>
                    </List>
                  </Collapse>
                </List>
              </div>
            </div>
          </CodeExample>
        </div>
      </div>

      <div className="row">
        <div className="col-md-6">
          <CodeExample jsCode={jsCode3} beforeCodeTitle="Folder List">
            <div className="kt-section">
              <span className="kt-section__sub"></span>
              <div className="kt-section__content">
                <List className={classes3.root}>
                  <ListItem>
                    <ListItemAvatar>
                      <Avatar>
                        <ImageIcon />
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText primary="Photos" secondary="Jan 9, 2014" />
                  </ListItem>
                  <ListItem>
                    <ListItemAvatar>
                      <Avatar>
                        <WorkIcon />
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText primary="Work" secondary="Jan 7, 2014" />
                  </ListItem>
                  <ListItem>
                    <ListItemAvatar>
                      <Avatar>
                        <BeachAccessIcon />
                      </Avatar>
                    </ListItemAvatar>
                    <ListItemText
                      primary="Vacation"
                      secondary="July 20, 2014"
                    />
                  </ListItem>
                </List>
              </div>
            </div>
          </CodeExample>
        </div>
        <div className="col-md-6">
          <CodeExample jsCode={jsCode4} beforeCodeTitle="Interactive">
            <div className="kt-section">
              <span className="kt-section__sub">
                Below is an interactive demo that lets you explore the visual
                results of the different settings:
              </span>
              <div className="kt-separator kt-separator--dashed"></div>
              <div className="kt-section__content">
                <div className={classes4.root}>
                  <FormGroup row>
                    <FormControlLabel
                      control={
                        <Checkbox
                          checked={dense4}
                          onChange={event => setDense4(event.target.checked)}
                          value="dense"
                        />
                      }
                      label="Enable dense"
                    />
                    <FormControlLabel
                      control={
                        <Checkbox
                          checked={secondary4}
                          onChange={event =>
                            setSecondary4(event.target.checked)
                          }
                          value="secondary"
                        />
                      }
                      label="Enable secondary text"
                    />
                  </FormGroup>
                  <Grid container spacing={2}>
                    <Grid item xs={12} md={6}>
                      <Typography variant="h6" className={classes4.title}>
                        Text only
                      </Typography>
                      <div className={classes4.demo}>
                        <List dense={dense4}>
                          {generate(
                            <ListItem>
                              <ListItemText
                                primary="Single-line item"
                                secondary={secondary4 ? "Secondary text" : null}
                              />
                            </ListItem>
                          )}
                        </List>
                      </div>
                    </Grid>
                    <Grid item xs={12} md={6}>
                      <Typography variant="h6" className={classes4.title}>
                        Icon with text
                      </Typography>
                      <div className={classes4.demo}>
                        <List dense={dense4}>
                          {generate(
                            <ListItem>
                              <ListItemIcon>
                                <FolderIcon />
                              </ListItemIcon>
                              <ListItemText
                                primary="Single-line item"
                                secondary={secondary4 ? "Secondary text" : null}
                              />
                            </ListItem>
                          )}
                        </List>
                      </div>
                    </Grid>
                  </Grid>
                  <Grid container spacing={2}>
                    <Grid item xs={12} md={6}>
                      <Typography variant="h6" className={classes4.title}>
                        Avatar with text
                      </Typography>
                      <div className={classes4.demo}>
